import React from "react";

const Blog = (props) => {
    return (
        <div>
            <img src="https://placeimg.com/640/480/tech" alt="" />
            <p>Tanggal Blog</p>
            <p>Judul Blog</p>
            <p>Summary Blog</p>
        </div>
    )
}

export default Blog;
